from django.conf.urls import url, includefrom . import viewsfrom django.contrib.auth.views import login,logoutapp_name = 'Billboard_site'urlpatterns = [    url(r'^$', views.index, name='index'),    url(r'^newpost$', views.newpost, name='newpost'),    url(r'^register/$', views.register, name='register'),    url(r'^django.contrib.auth.views.login/$', login, kwargs={'template_name': 'registration/login.html'}, name='login'),    url(r'^logout_view/$', views.logout_view, name='logout_view'),]